import React from 'react'
import { formContainer, Input, Button } from './styles'

function Form({input, setInput}) {
  return (
    <formContainer>
        <Input 
        value={input}
        onChange={(e) => setInput(e.target.va)}
        type='text'
        role='input'/>
        <Button type='submit'> Add </Button>
    </formContainer>
  )
}

export default Form
